import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import "./App.css";

import Navbar from '../components/Navbar/Navbar';
import Home from '../components/Home/Home';
import About from '../components/About/About';
import Des from '../components/About/About';


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar title="Magical travels"/>
        <Route exact path="/" render={() => <Home title="magical travel" />} />
        <Route exact path="/about" render={() => <About title="about us" />} />
        <Route exact path="/destination" render={() => <About title="about us" />} />


      </div>
    </BrowserRouter>
  );
}

export default App;
